tables.table_schema:
CREATE TABLE financial_data (
    id INT PRIMARY KEY,
    date DATE NOT NULL,
    amount DECIMAL NOT NULL,
    category VARCHAR(50) NOT NULL
);

CREATE TABLE financial_data (
    date TIMESTAMP,
    revenue DECIMAL,
    expenses DECIMAL,
    profit DECIMAL
);

CREATE TABLE stock_prices (
    date TIMESTAMP,
    symbol VARCHAR(10),
    price DECIMAL
);

CREATE TABLE market_trends (
    date TIMESTAMP,
    trend VARCHAR(50)
);

CREATE TABLE historical_data (
  date DATE NOT NULL,
  value DECIMAL NOT NULL
);

CREATE TABLE financial_trends (
  trend_id INT PRIMARY KEY,
  trend_description VARCHAR(255) NOT NULL
);

CREATE TABLE opportunities (
  opportunity_id INT PRIMARY KEY,
  opportunity_description TEXT NOT NULL,
  potential_profit DECIMAL NOT NULL
);

CREATE TABLE predictions (
  prediction_id INT PRIMARY KEY,
  prediction_date DATE NOT NULL,
  predicted_value DECIMAL NOT NULL
);

CREATE TABLE analysis (
  analysis_id INT PRIMARY KEY,
  analysis_description TEXT NOT NULL
);
